console.log(entry)
    return(
        <section>
            <h3>{entry.date}, <Icon className={showIconType(entry.type)}/>, {entry.employerName}</h3>
            <p>{entry.description}</p>
        </section>
    )
}

export default OccupationalHealthcare;
